script: |
  super -f text -I q10602.spq | sort > q10602.out

inputs:
  - name: q10602.spq
    data: |
      SELECT DISTINCT - 79 / tab0.col2 AS col1 FROM tab0 (FORMAT parquet), tab2 (FORMAT parquet) AS cor0;
  - name: tab0
  - name: tab2

outputs:
  - name: q10602.out
    data: |
      -2
      -79
      0
